import './App.css';

function App() {
  const apiKey = '72095579eb8b2c9381a1d588e381fcbe';
  let citySearch;
  const fetching = `https://api.openweathermap.org/data/2.5/weather?q=${citySearch}id=6167865&appid=${apiKey}`;
  const current = new Date()
  const temperature = "15";
  const startFetch = (e) => {
    if(e.key === "Enter") {
      alert("PIZZA")
    }
  }
  return (
    <div className="App">
      <main>
        <div className='searchCity' >
          <input type="text" className="searchBar" placeholder="Search City" onKeyUp={this.startFetch} />
        </div>
        <div className="place">
          <h2>Tatuí, Br</h2>
        </div>
        <div className="dates">
          <h2>{current.getUTCDate()}/{current.getUTCMonth()+1}/{current.getUTCFullYear()}</h2>
          <h3>{current.getHours()}:{current.getMinutes() < 10? '0' + current.getMinutes() : current.getMinutes()}:{current.getSeconds() < 10? '0' + current.getSeconds() : current.getSeconds()}</h3>
        </div>
        <div className='temperature'>
          <p className="temperatureDisplay">{temperature+"ºC"}</p>
        </div>
      </main>
    </div>
  );
}

